import React from "react";
//import { Component } from 'react';
import axios from "axios";
import { useState } from "react";

const sample = [
  {
    payerAccount: "200001020112",
    payeeAccount: "200001020919",
    transactionRef: "123452359012",
    amount: "9993.00",
    payerName: "AnilMehtanin",
    transactionDate: "02012018",
    payeeName: "KanyaKaur",
    validations: "pass",
    screening: "pass",
    transactionId: "2",
  },
  {
    payerAccount: "200001060111",
    payeeAccount: "200001520999",
    transactionRef: "156456789012",
    amount: "329.00",
    payerName: "VimalSukumar",
    transactionDate: "02012018",
    payeeName: "MohiniChawal",
    validations: "pass",
    screening: "pass",
    transactionId: "6",
  },
];

function Header() {
  return (
    <div className="header">
      <div className="row">
        <div className="col-2">
          <button>Screen-Pass</button>
        </div>

        <div className="col-2">
          <button style={{ paddingLeft: "20px" }}>Screen-Fail</button>
        </div>
        <div className="col-2">
          <button>Validate-Pass</button>
        </div>
        <div className="col-2">
          <button>Validate-Fail</button>
        </div>
      </div>
    </div>
  );
}

export default Header;
